const xLabels = [
  "Page A",
  "Page B",
  "Page C",
  "Page D",
  "Page E",
  "Page F",
  "Page G",
];

export default function Feed() {
  return (
    <div className=" bg-white  p-4 rounded-md mt-2 ">
